import React, { useState } from "react";
import { Menu, Switch, Button, Col } from "antd";
import { Link } from "react-router-dom";
import "./css/styles.css";
import Media from "react-media";
import {
  MailOutlined,
  CalendarOutlined,
  AppstoreOutlined,
  SettingOutlined,
  MenuUnfoldOutlined,
  MenuFoldOutlined,
  HomeOutlined,
} from "@ant-design/icons";
const Index = (props) => {
  const [current, setCurrent] = useState("home");
  const handleClick = (e) => {
    setCurrent(e.key);
  };
  const { SubMenu } = Menu;

  return (
    <Menu
      onClick={handleClick}
      selectedKeys={current}
      mode="horizontal  "
    >
      <Row>
        <Col ></Col>
        <Col flex></Col>
        <Col flex></Col>
        <Col flex></Col>

      </Row>
    </Menu>
  );
};

export default Index;
